window.bookSummaryJSON = "<p>The Wilderlands are said to contain many dangers. On most maps, the area remains blank and only the bravest of travelers will venture beneath its canopy. For monsters roam these woods, which made it the perfect place for a legendary swordmaster to disappear from the world for a time and raise a child.</p> <p>For 17 years Holviti of Yuutan rased Duren in those woods, training in the sword, hunting the creatures that called it home, but as is the case with all young men, there comes a day when one must leave his fathers home and make their own mark on the world. Duren had no idea what awaited him in the world, but he was definitely looking forward to finding out. Sword in hand and Holviti’s lessons in his head he set out, thinking he was prepared for anything in the world. Up until the point he met her that was….</p> <p>Author’s note: This book contains an overpowered main character, graphic violence, creative language, sexual innuendos, and quite a few moments that cracked my creative consultant up. You have been warned....</p>"; 
